package com.zhzx.dao.model.prod;import com.zhzx.dao.model.BaseModel;public class ProdPlanModel extends BaseModel {		/**	* 活动策划表	*/	private String id;		/**	*活动名称	*/	private String planname;		/**	*活动描述	*/	private String plandesc;		/**	*活动状态（活动有效：1，活动失效：0）	*/	private String status;		/**	*活动开始时间	*/	private String starttime;		/**	*活动结束时间	*/	private String endtime;		/**	*创建时间	*/	private String createtime;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getPlanname() {	    return this.planname;	}	public void setPlanname(String planname) {	    this.planname=planname;	}	public String getPlandesc() {	    return this.plandesc;	}	public void setPlandesc(String plandesc) {	    this.plandesc=plandesc;	}	public String getStatus() {	    return this.status;	}	public void setStatus(String status) {	    this.status=status;	}	public String getStarttime() {	    return this.starttime;	}	public void setStarttime(String starttime) {	    this.starttime=starttime;	}	public String getEndtime() {	    return this.endtime;	}	public void setEndtime(String endtime) {	    this.endtime=endtime;	}	public String getCreatetime() {	    return this.createtime;	}	public void setCreatetime(String createtime) {	    this.createtime=createtime;	}	}